(299, 'What does HTML stand for?', 'Hyperlinks and Text Markup Language', 'Hyperactive Text Me Lenglui', 'Hyper Text Markup Language', 'Home Tool Markup Language', 'C', 'The correct answer is C. HTML (HyperText Markup Language) is the code that is used to structure a web page and its content. For example, content could be structured within a set of paragraphs, a list of bulleted points, or using images and data tables.', 'TP0', 30, 1, 'N', 'Y'),
(300, 'Choose the correct HTML tag for the largest heading', '<heading>', '<h6>', '<head>', '<h1>', 'D', 'The correct answer is D. <h1> also known as Heading 1 is the largest heading tag typically used for emphasizing tpoic titles. <heading> does not exist in HTML tag elements. <h6> is the smallest heading tag in HTML. <head> is used to define the metadata of the HTML page.', 'TP0', 30, 1, 'N', 'Y'),
(302, 'What is the correct HTML tag for inserting a line break?', '<br>', '<lb>', '<break>', '<brake>', 'A', 'The correct answer is A. <br> is the HTML tag element used for making line breaks. This tag element exists because linebreaks in code will only structure your code for better viewing. It does not affect the front end.', 'TP0', 30, 1, 'N', 'Y'),
(303, 'Inside which HTML element do we put the JavaScript?', '<javascript>', '<js>', '<scripting>', '<script>', 'D', 'The correct answer is D. In HTML, JavaScript code is inserted between <script> and </script> tags. Old JavaScript examples may use a type attribute: <script type=\"text/javascript\">.\r\nThe type attribute is not required. JavaScript is the default scripting language in HTML.', 'TP0', 31, 1, 'N', 'N'),
(304, 'What is the correct JavaScript syntax to change the content of the HTML element below?\r\n\r\n<p id=\"demo\">This is a demonstration.</p>', 'document.getElementById(\"demo\").innerHTML = \"Hello World\";', 'document.getElementById(\"p\").innerHTML = \"Hello World\";', 'document.getElementByName(\"p\").innerHTML = \"Hello World\";', '#demo.innerHTML = \"Hello World\";', 'A', 'The correct answer is A. This is because the id attribute of the p tag is \"demo\". When using getElementById(), you should provide the id of the tag element.', 'TP0', 31, 1, 'N', 'N'),
(305, 'Where is the correct place to insert a JavaScript?', 'The <head> section', 'The <body> section', 'Both the <head> and <body> section are correct', 'Neither of the options are correct', 'C', 'The correct answer is C. You can put the script tag in both <head> and <body> tags and they will still work.', 'TP0', 31, 1, 'N', 'N'),
(306, 'What is the correct syntax for referring to an external script called \"xxx.js\"?', '<script src=\"xxx.js\">', '<script name=\"xxx.js\">', '<script href=\"xxx.js\">', '<script ref=\"xxx.js\">', 'A', 'The correct answer is A. The correct syntax for referring to an external script is by adding the src attribute tot the script tag.', 'TP0', 31, 1, 'N', 'N'),
(307, 'Who is making the Web standards?', 'Google', 'Mozilla', 'Microsoft', 'The World Wide Web Consortium', 'D', 'The correct answer is D. The central organization who is responsible for creating and maintaining web standards is the World Wide Web Consortium (W3C). The W3C has defined dozens of standards, including the standard markup languages we use to build websites.', 'TP0', 30, 1, 'N', 'N');

